{'publishedAt': '2023-05-23T22:56:01Z', 'channelId': 'UCkR6xPOHhpjq3wnFchVI4sg', 'title': '“Vini Jr. é vencedor”. O polêmico discurso do Sen. Magno Malta', 'description': 'Sen. @magnomalta não é racista. Compartilho sua mensagem: “Hoje, dia 23, durante a reunião da Comissão de Assuntos Econômicos (CAE) do Senado, fiz um discurso sobre o jogador Vini Jr., que foi alvo de racismo na Espanha. No entanto, alguns veículos de comunicação fizeram um recorte inadequado da minha fala. Permita-me fazer uma breve explicação:

Em primeiro lugar, gostaria de ressaltar que sou negro e, portanto, minha fala não foi racista. Meu objetivo era chamar a atenção para uma questão séria. Acharam meu discurso estranho? Essa é minha reflexão sobre o racismo. É inadmissível, no século XXI, termos uma história tão ilógica como o racismo. Não deveríamos categorizar as pessoas por raça, mas sim enxergá-las como seres humanos, reconhecendo suas características e habilidades no mundo.

Num mundo em constante evolução, é fundamental reconhecer que o racismo ainda é uma questão real e relevante em nossas sociedades, o que é lamentável. Apesar dos avanços significativos que fizemos em relação à igualdade e à justiça, parece que o racismo é uma narrativa desconexa e ultrapassada. É uma triste metáfora para aqueles que são extraordinários, mas sofrem devido à cor da pele ou origem étnica.”', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/cLLoubcDUwo/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/cLLoubcDUwo/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/cLLoubcDUwo/hqdefault.jpg', 'width': 480, 'height': 360}}, 'channelTitle': 'EDUARDO BOLSONARO', 'playlistId': 'UUkR6xPOHhpjq3wnFchVI4sg', 'position': 13, 'resourceId': {'kind': 'youtube#video', 'videoId': 'cLLoubcDUwo'}, 'videoOwnerChannelTitle': 'EDUARDO BOLSONARO', 'videoOwnerChannelId': 'UCkR6xPOHhpjq3wnFchVI4sg'}

